import './App.css';
import NavBar from "./components/NavBar"
import ButtonGenerator from './components/ButtonGenerator';
import MemeForm from './components/MemeForm'
import { Container,Row, Col} from 'react-bootstrap'

function App() {
  return (
    <div className="App">
      <NavBar />
      <Container fluid="md">
        <Row>
            <Col>
              <ButtonGenerator />
              </Col>
        </Row>
        <Row>
          <Col>
              <MemeForm />
          </Col>
        </Row>
      </Container>
    </div>
  );
}

export default App;
